<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <link rel="stylesheet" href="css/style.css">
    <link rel="stylesheet" href="css/all.min.css">
    <script defer type="text/javascript" src="js/script.js"></script>
    <link href="https://fonts.googleapis.com/css2?family=Inter&display=swap" rel="stylesheet">
    <title>JavaScript_16</title>
</head>
<body>
    <div class="git-page">
        <div class="git-header">
            <div class="git-left">
                <a href="https://github.com/" class="git-icon fa-brands fa-github"></a>
                <a href="https://github.com/pulls" class="git-left-link">Pull requests</a>
                <a href="https://github.com/issues" class="git-left-link">Issues</a>
                <a href="https://github.com/marketplace" class="git-left-link">Marketplace</a>
                <a href="https://github.com/explore" class="git-left-link">Explore</a>
            </div>
            <div class="git-right">
                <a href="https://github.com/notifications" class="git-bell fa-regular fa-bell"></a>
                <div class="git-plus-list">
                    <div class="git-plus">+</div>
                    <div class="git-carret-down fa-solid fa-caret-down"></div>
                </div>
                <div class="git-profile-list">
                    <div class="git-profile"></div>
                    <div class="git-carret-down fa-solid fa-caret-down"></div>
                </div>
            </div>
        </div>
        <div class="git-header-fixed">
            <div class="git-header-fixed-inside">
                <a href="#" class="git-header-fixed-block">
                    <div class="git-fixed-block">
                        <div class="git-fixed-icon fa-regular fa-bookmark"></div>
                        <div class="git-fixed-txt">Overview</div>
                    </div>
                    <div class="git-fixed-line"></div>
                </a>
                <a href="https://github.com/Romashka13579?tab=repositories" class="git-header-fixed-block">
                    <div class="git-fixed-block">
                        <div class="git-fixed-icon fa-solid fa-book"></div>
                        <div class="git-fixed-txt">Repositories</div>
                    </div>
                    <div class="git-fixed-line"></div>
                </a>
                <a href="https://github.com/Romashka13579?tab=projects" class="git-header-fixed-block">
                    <div class="git-fixed-block">
                        <div class="git-fixed-icon fa-regular fa-square"></div>
                        <div class="git-fixed-txt">Projects</div>
                    </div>
                    <div class="git-fixed-line"></div>
                </a>
                <a href="https://github.com/Romashka13579?tab=packages" class="git-header-fixed-block">
                    <div class="git-fixed-block">
                        <div class="git-fixed-icon fa-solid fa-cube"></div>
                        <div class="git-fixed-txt">Packages</div>
                    </div>
                    <div class="git-fixed-line"></div>
                </a>
                <a href="https://github.com/Romashka13579?tab=stars" class="git-header-fixed-block">
                    <div class="git-fixed-block">
                        <div class="git-fixed-icon fa-regular fa-star"></div>
                        <div class="git-fixed-txt">Stars</div>
                    </div>
                    <div class="git-fixed-line"></div>
                </a>
            </div>
        </div>
        <div class="git-page">
            <div class="git-page-left">
                <div class="git-page-left-logo"></div>
                <div class="git-page-left-namenick">
                    <div class="git-page-left-name"></div>
                    <div class="git-page-left-nick"></div>
                </div>
            </div>
            <div class="git-page-right"></div>
        </div>
        <div class="git-footer"></div>
    </div>
</body>
</html>
